    "2016-11-02T19:11:38.427888",nt"name": "edwin-b-forsythe-national-wildlife-refuge-brigantine-division-annual-narrative-report-cale-5fca8",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for the Brigantine
    Division of Edwin B. Forsythe National Wildlife Refuge outlines Refuge accomplishments
    during the 1985 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning, public participation, compliance with
    environmental and cultural resource mandates, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, and safety is given. Habitat management is also covered; subjects
    include wetlands, forests, grasslands, fire management, pest control, and wilderness
    areas. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, animal control, and marking and bird banding. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, equipment replacement, and communication systems. Cooperative programs
    and items of interest are provided at the end. Refuge brochures and field guides
    are attached.",nt"license_title": "License Not Specified",nt"extras":
